import React from 'react'

export default function Scheudle() {
    const [events, setEvents] = React.useState([]);
    React.useEffect(() => {
        let url = "adonix.hackillinois.org/event/"
        fetch(url)
            .then((response) => response.json())
            .then((data) => {
                setEvents(data.events);
            })
    })
}
